ExtraTreesRegressor:
  functions:
    model_create:
      bootstrap: false
      criterion: mse
      max_features: auto
      min_impurity_decrease: 0.0
      min_samples_leaf: 1
      min_samples_split: 2
      min_weight_fraction_leaf: 0.0
      n_estimators: warn
      n_jobs: -1
      oob_score: false
      verbose: 0
      warm_start: false
  model:
    model_class: sklearn.ensemble.ExtraTreesRegressor
    model_type: regression
